import { Container } from "@mui/material";
import React, { useState } from "react";
import Workout from "./Components/Cards";
import NavBar from "./Components/NavBar";
import WorkoutDetails from "./Components/WorkoutDetails";
import WorkoutPlan from "./Components/WorkoutPlans";

const Desktop: React.FC = () => {
  const [showWorkoutPlan, setShowWorkoutPlan] = useState(false);
  const [selectedWorkoutIndex, setSelectedWorkoutIndex] = useState<number | null>(null);

  const workoutData = [
    { id: 1, title: 'Workout 1', description: 'This is workout 1 consisting of Workouts', image: './images/Workout1.jpg', onClickPlan: () => handleWorkoutClick(0) },
    { id: 2, title: 'Workout 2', description: 'This is workout 2 consisting of Workouts', image: './images/Workout1.jpg', onClickPlan: () => handleWorkoutClick(1) },
    { id: 3, title: 'Workout 3', description: 'This is workout 3 consisting of Workouts', image: './images/Workout1.jpg', onClickPlan: () => handleWorkoutClick(2) },
    // Add more workout data as needed
  ];

  const workoutPlanData = {
    workoutImage: '/path/to/workout-image.jpg',
    workouts: [
      { name: 'Workout 1', reps: 10, sets: 3 },
      { name: 'Workout 2', reps: 12, sets: 4 },
      { name: 'Workout 3', reps: 8, sets: 4 },
      // Add more workout plan data as needed
    ],
    startButtonColor: 'primary',
  };

  const onNavigateBack = () => {
    setShowWorkoutPlan(false);
    setSelectedWorkoutIndex(null);
  };

  const handleWorkoutClick = (index: number) => {
    setSelectedWorkoutIndex(index);
    setShowWorkoutPlan(true);
  };

  return (
    <Container>
      <NavBar onNavigateBack={onNavigateBack} />
      {!showWorkoutPlan && (
        <div style={{ display: 'flex', justifyContent: 'center', padding: '20px', flexWrap: 'wrap' }}>
          {workoutData.map((workout) => (
            <Workout key={workout.id} {...workout} />
          ))}
        </div>
      )}
      {showWorkoutPlan && selectedWorkoutIndex !== null && (
        <WorkoutPlan workouts={workoutPlanData.workouts} />
      )}
      {showWorkoutPlan && selectedWorkoutIndex !== null && (
        <WorkoutDetails workoutName={`Workout ${selectedWorkoutIndex + 1}`} />
      )}
    </Container>
  );
};

export default Desktop;
